package main

import "testing"

func TestRun(t *testing.T) {
	tests := []struct {
		str  string
		want string
		name string
	}{
		{
			str:  "aabab",
			want: "NO",
			name: "case 1",
		},
		{
			str:  "",
			want: "YES",
			name: "case 2",
		},
		{
			str:  "aabbaabbaa",
			want: "NO",
			name: "case 3",
		},
		{
			str:  "",
			want: "YES",
			name: "case 4",
		},
		{
			str:  "zYJz",
			want: "NO",
			name: "case 5",
		},
	}

	for _, test := range tests {
		t.Run(test.name, func(t *testing.T) {
			got := Run(test.str)

			if got != test.want {
				t.Errorf("Expected: %v, got: %v", test.want, got)
			}
		})
	}
}
